func computePartOne(terrain [][]string, slopeX int, slopeY int) int {
	numTreesVisited, currX, currY := 0, 0, 0
	numRowsInTerrain, numColsInTerrainRow := len(terrain), len(terrain[0])

	for currY < numRowsInTerrain {
		if currY + slopeY >= numRowsInTerrain {
			break
		}
		currX, currY = (currX+slopeX)%numColsInTerrainRow, currY+slopeY
		if terrain[currY][currX] == "#" {
			numTreesVisited++
		}
	}

	return numTreesVisited
}

func computePartTwo(terrain [][]string) int {
	slopeOneAns := computePartOne(terrain, 1, 1)
	slopeTwoAns := computePartOne(terrain, 3, 1)
	slopeThreeAns := computePartOne(terrain, 5, 1)
	slopeFourAns := computePartOne(terrain, 7, 1)
	slopeFiveAns := computePartOne(terrain, 1, 2)

	return slopeOneAns * slopeTwoAns * slopeThreeAns * slopeFourAns * slopeFiveAns
}
